import time

class Solution(object):
    def pushDominoes(self, dominoes):
        """
        :type dominoes: str
        :rtype: str
        """
        if not dominoes :
            return dominoes
        length = len(dominoes)
        pre = "L"
        i = 0
        res = []
        while True:
            count = i
            while i < length and dominoes[i] == ".":
                i += 1
                        
            if i == length:
                if pre == "R":
                    res.append("R" * (i - count))
                else:
                    res.append("." * (i - count))
                break
            #  L ... R
            elif dominoes[i] == "R" and pre == "L":
                res.append("." * (i - count))
                pre = "R"
            #  L ... L
            elif dominoes[i] == "L" and pre == "L":
                res.append("L" * (i - count))
                pre = "L"
            #  R ... R
            elif dominoes[i] == "R" and pre == "R":
                res.append("R" * (i - count))
                pre = "R"
            # R ... L
            elif dominoes[i] == "L" and pre == "R":
                res.append((i - count) /2*"R")
                res.append( (i - count) %2 * ".")
                res.append((i - count) /2 * "L")
                pre = "L"
            res.append(dominoes[i])
            i += 1
            
        return "".join(res)
    
